import React from "react";
import {
  ModalBody,
  ModalFooter,
  ModalHeader,
  ModalTitle,
} from "react-bootstrap";

export default function ModalComp(props: any) {
  return (
    <div>
      <ModalHeader closeButton onClick={props.initModal}>
        <ModalTitle>{props.title ?? ""}</ModalTitle>
      </ModalHeader>
      <ModalBody>{props.body}</ModalBody>
    </div>
  );
}
